export default function VitalForm() {

  const handleClose = () => {
    setOpen(false);
    console.log('button values');
  };

  return (
    <div>
    <form>
     <label>
       Is going:
       <input
         name="isGoing"
         type="checkbox"
         checked={handleClose}
         onChange={handleClose} />
     </label>
     <br />
     <label>
       Number of guests:
       <input
         name="numberOfGuests"
         type="number"
         value="1"
         onChange={handleClose} />
     </label>
   </form>
    </div>
  );
}
